import { Box, Container } from '@mui/system';
import React,{ useState } from 'react';
import { useTheme } from '@emotion/react';
import { 
    FormControlLabel,
    Checkbox,
    Typography,
    Button,
    Dialog,
    DialogContent,
    DialogContentText,
    DialogActions,
    DialogTitle,
    List,
    ListItem,
    ListItemText
    } from '@mui/material';
import DeleteForeverIcon from '@mui/icons-material/DeleteForever';


const ItemList=()=>{
    const theme = useTheme();
    const secondary = theme.palette.secondary.main;
    const colorgrey1 = theme.palette.gray1.main;
    const colorgrey2 = theme.palette.gray2.main;
    const colorgrey3 = theme.palette.gray3.main;
    return(
        <Box
        display='flex'
        flexDirection='row'
        height='157px'
        borderBottom='1px solid #BDBDBD'
        mb='10px'
        >
            <Checkbox sx={{
                mb:'20px',
                mr:'35px',
            }}/>
            <Box
            component='img'
            src = "./Ramen.png"
            width = '200px'
            height = '133px'
            />
            <Container
            display="flex"
            flexDirection="column"
            alignItems="flex-start"
            gap='8px'>
                <Typography fontWeight={400} fontSize='16px' sx={{color: colorgrey3}}>
                    Asian
                </Typography>
                <Typography fontWeight={600} fontSize='24px' sx={{color: colorgrey1}}>
                    Ichiraku Ramen
                </Typography>
                <Typography fontWeight={400} fontSize='18px' sx={{color: colorgrey2}}>
                    Ichiraku Ramen
                </Typography>
                <Typography fontWeight={600} fontSize='20px' color='secondary'>
                    IDR 300.000
                </Typography>

            </Container>
            <DeleteForeverIcon
            fontSize="large"
            sx={{
                color: '#EB5757',
                mt:"40px"
            }}/>

        </Box>
    );
};

const Gopay = () =>{
    return(
    <Box
    sx={{
        display:'flex',
        flexDirection:'row',
        alignItems:'center',
        gap:'16px',
        justifyContent:'flex-start'
    }}>
        <Box
        component='img'
        src='./Soup/Gopay.svg'
        width='326px'
        height='40px'
        sx={{
            textAlign:'left'
        }}/>
        <Typography fontWeight={500} fontSize='18px'>
            Gopay
        </Typography>

    </Box>
    )
};

const payment = [<Gopay/>,'OVO','DANA','Mandiri','BCA','BNI'];

const Checkout = () => {
    const [open, setOpen] = useState(false);

    const theme = useTheme();
    const primaryColor = theme.palette.primary.main;

    const handleListItemClick = () => {
        setOpen(false);
      };

  return (
    <Box 
    display="flex"
    flexDirection="column"
    >
    <Container>
        <Box
        display='flex'
        flexDirection='column'
        alignItems='flex-start'
        height='50px'
        borderBottom='1px solid #BDBDBD'
        mt='40px'
        mb='24px'
        >
            <FormControlLabel
            value="selectAll"
            control={<Checkbox />}
            label="Pilih Semua"
            labelPlacement="end"
            sx={{
                gap:'35px',
            }}/>
        </Box>
            <ItemList/>
            <ItemList/>
            <ItemList/>

    </Container>
        <Box
        position="fixed"
        width="100%"
        height="100px"
        display="flex"
        alignItems="center"
        bottom='0px'
        borderTop="1px solid #BDBDBD"
        backgroundColor="white"
        sx={{
            filter: 'drop-shadow(0px -2px 3px rgba(0, 0, 0, 0.25))'
        }}
        >
            <Container
            width="1140px"
            sx={{
                display: 'flex',
                gap: '24px',
                alignItems: 'center',
            }}
            >
                <Typography display='flex' fontWeight={400} fontSize="18px" color='gray1'>
                    Total Price
                </Typography>
                <Typography display='flex' fontWeight={600} fontSize="24px" color='secondary'>
                    IDR 11.500.000
                </Typography>
                <Button 
                variant="contained"
                color="secondary"
                display="flex"
                sx={{
                    position:'absolute',
                    right:'70px',
                    width:'233px',
                    height:'40px',
                    color:primaryColor,
                }}
                onClick={() => setOpen(true)}>
                    Pay Now
                </Button>

                <Dialog open={open} onClose={()=> setOpen(false)}>
                    <DialogTitle>Select Payment Method</DialogTitle>

                    <List sx={{ pt: 0 }}>
                    {/* <ListItem>
                        <Gopay/>
                    </ListItem> */}
                    {payment.map((payment) => (
                    <ListItem button onClick={() => handleListItemClick(payment)} key={payment}>
                        {/* <ListItemAvatar>
                        <Avatar sx={{ bgcolor: blue[100], color: blue[600] }}>
                            <PersonIcon />
                        </Avatar>
                        </ListItemAvatar> */}
                        <ListItemText primary={payment} />
                    </ListItem>
                    ))}

                </List>
                </Dialog>

            </Container>
        </Box>
    </Box>
  )
}

export default Checkout
